import { Iconos } from "../../Components/Iconos/Iconos"
import { BsHouseDoor, BsPerson } from 'react-icons/bs';

export const Navbar = () => {
    
    return(
        <div className="col">
            <Iconos icons={ <BsHouseDoor/> } title={"Home"}/>
            <Iconos icons={ <BsPerson/> } title={"My Profile"}/>
        </div>
    )
}
